    public:
        ArchivoPunto1(const char *n){
            strcpy(nombre, n);
        }
        Punto1 leerRegistro(int pos){
            Punto1 reg;
            FILE *p=fopen(nombre,"rb");
            if(p==NULL){
                return reg;
            }
            fseek(p, pos * sizeof reg, 0);
            fread(&reg, sizeof reg, 1, p);
            fclose(p);
            return reg;
        }
        bool grabarRegistro(Punto1 reg){
            FILE *p;
            p=fopen(nombre, "ab");
            if(p==NULL) return false;
