		switch (C) {
		case ' ' : case '\t' : case '\r' : case '\n' : 
		  if (!WasSpace) { *pOut++ = ' '; }
			WasSpace=1; break;
		default: 
		  *pOut++ = C; WasSpace=0;
		}
	}
	while (pOut[-1]==' ') { pOut--; }
	*pOut = '\0';	
}

